            $('.vive').show();
            $('#TituloDomicilio').html('Domicilio');
            $('.defuncion').hide();
            if ($('#ConviveSi').is(':checked')) {
                $('.convive').hide();
            } else {
                if ($('#Domicilio_ViveExterior').is(':checked')) {
                    $('.selectLocal').hide();
